B.EU=new A.af("Mecanismo de acci\xf3n","La vancomicina es un antibi\xf3tico glucop\xe9ptido tric\xedclico que inhibe la s\xedntesis de la pared celular en bacterias sensibles mediante una uni\xf3n de gran afinidad con el extremo D-alanil-D-alanina de las unidades precursoras de la pared celular.El f\xe1rmaco es bactericida para microorganismos en divisi\xf3n. Adem\xe1s, afecta la permeabilidad de la membrana celular bacteriana y la s\xedntesis de ARN.",null)
B.EX=new A.af("Presentaci\xf3n","Minipress, comp.1, 2 y 5 mg",null)
B.EY=new A.af("Indicaciones","Tratamiento de enfermedades inflamatorias y autoinmunes en ads. y ni\xf1os >= 1 mes: asma bronquial, alteraciones al\xe9rgicas e inflamatorias, artritis reumatoide y otras colagenopat\xedas, dermatitis y dermatosis.",null)
B.EZ=new A.af("V\xedas de administraci\xf3n","Oral",null)
B.F0=new A.af("Mecanismo de acci\xf3n","La furosemida es un diur\xe9tico que act\xfaa r\xe1pidamente y tiene una duraci\xf3n corta. Funciona bloqueando un sistema de transporte de sodio (Na +), potasio(K+) y cloruro (2Cl-) en la membrana celular de la parte ascendente del asa de Henle en el ri\xf1\xf3n. Su efecto diur\xe9tico se debe a la inhibici\xf3n de la reabsorci\xf3n de cloruro de sodio en esta parte del ri\xf1\xf3n.",null)
B.F1=new A.af("V\xeda Oral","Prevenci\xf3n de n\xe1useas y v\xf3mitos retardados inducidos por quimioterapia como opci\xf3n de segunda l\xednea.",null)
B.F6=new A.af("Mecanismo de acci\xf3n","Suprime la inmunidad celular (inhibe la activaci\xf3n de los linfocitos T), uni\xe9ndose a una prote\xedna intracelular, FKBP-12 y formando complejos con prote\xednas dependientes de calcineurina para inhibir la actividad de la calcineurina fosfatasa.",null)
B.F7=new A.af("Mecanismo de acci\xf3n","Reduce la actividad de nociceptores sensibles a la activaci\xf3n de dolor y centralmente al actuar sobre la sustancia gris periacueductal, activando las dos isoformas de las ciclooxigenasas (COX-1 y COX-2) a nivel perif\xe9rico, reduciendo la actividad de nociceptores sensibles a la activaci\xf3n del dolor y activando las v\xedas inhibitorias del dolor.",null)
B.Fa=new A.af("V\xedas de administraci\xf3n","V\xeda oral.",null)
B.Fb=new A.af("Mecanismo de acci\xf3n","Inhibe la proliferaci\xf3n, y por lo tanto, la expansi\xf3n clonal de las c\xe9lulas T activadas por ant\xedgenos, lo cual es mediado por interleucinas espec\xedficas de las c\xe9lulas T (interleucina-2 y -15).",null)
B.Fc=new A.af("V\xeda de administraci\xf3n","Oral",null)
B.Fd=new A.af("Mecanismo de acci\xf3n","Antagonista del calcio, por su estructura qu\xedmica es una dihidropiridina. Los calcio antagonistas act\xfaan en los canales lentos de calcio (localizados preferentemente en el miocardio y en la musculatura lisa vascular), pero el amlodipino es, sobre todo, vasodilatador. En el glom\xe9rulo renal causa dilataci\xf3n de la arteriola aferente, por lo que aumenta la filtraci\xf3n glomerular y el flujo renal.",null)
B.Fe=new A.af("Mecanismo de acci\xf3n","Ejerce su acci\xf3n bactericida inhibiendo la s\xedntesis de la pared celular bacteriana en bacterias Gram-positivas y Gram-negativas, lig\xe1ndose a las prote\xednas de uni\xf3n a penicilina.",null)
B.Ff=new A.af("V\xeda de administraci\xf3n","V\xeda oral. Puede utilizarse leche, caldo, zumo de naranja, etc., como veh\xedculos para facilitar la correcta administraci\xf3n.",null)
B.Fg=new A.af("Otros usos","Uso por v\xeda oral o intravenosa en reci\xe9n nacidos prematuros para el cierre del conducto arterioso persistente.",null)
B.Fi=new A.af("V\xeda de administraci\xf3n","Puede administrarse por v\xeda intravenosa (IV) o intramuscular (IM), dependiendo de la gravedad de la infecci\xf3n y la condici\xf3n cl\xednica del paciente.",null)
B.Fj=new A.af("Indicaciones","Se encuentra indicado en ni\xf1os mayores de 1 a\xf1o.",null)
B.Fl=new A.af("Indicaciones","La ampicilina/sulbactam se utiliza para tratar infecciones causadas por bacterias sensibles. Esto puede incluir infecciones del tracto respiratorio, infecciones del tracto urinario, infecciones de la piel y tejidos blandos, infecciones intraabdominales, entre otras.",null)
B.Fm=new A.af("V\xedas de administraci\xf3n","Intravenosa.",null)
B.Fn=new A.af("Mecanismo de acci\xf3n","Su acci\xf3n terap\xe9utica es principalmente analg\xe9sica, ansiol\xedtica, antitusiva y sedante. El mecanismo de acci\xf3n implica a los receptores opioides del sistema nervioso central para los componentes end\xf3genos con actividad opioide. Al igual que la morfina, la hidromorfona es un agonista opioide \u03bc1 selectivo completo.",null)
B.Fp=new A.af("Mecanismo de acci\xf3n","Inhibici\xf3n de la s\xedntesis de la pared bacteriana (en la fase de crecimiento) debido a la inhibici\xf3n de las prote\xednas de uni\xf3n a la penicilina. Pertenece al grupo de las cefalosporinas de cuarta generaci\xf3n.",null)
B.Fq=new A.af("Mecanismo de acci\xf3n","Grupo farmacoterap\xe9utico: Inhibidores de la enzima de conversi\xf3n de angiotensina. disminuye la presi\xf3n arterial, principalmente la inhibici\xf3n del sistema renina-angiotensina-aldosterona.",null)
B.Fr=new A.af("Mecanismo de acci\xf3n","La piperacilina es una penicilina semisint\xe9tica de amplio espectro, que ejerce su actividad bactericida mediante la inhibici\xf3n de la s\xedntesis de la pared celular y de los septos.",null)
B.Ft=new A.af("V\xeda de administraci\xf3n","Se administra normalmente por perfusi\xf3n intravenosa durante aproximadamente 15 a 30 minutos.",null)
B.Fu=new A.af("Mecanismo de acci\xf3n","Antagonista potente y altamente selectivo de los receptores de serotonina 5 HT3, actuando al bloquear la acci\xf3n de la serotonina la cual es una sustancia natural que puede causar n\xe1useas y v\xf3mitos.",null)
B.Fx=new A.af("Indicaciones","Tratamiento sintom\xe1tico del dolor leve o moderado y de la fiebre.",null)
B.Fy=new A.af("Presentaci\xf3n","Ampicilina/sulbactam Netpharmalab 1 g/0,5 g polvo para soluci\xf3n inyectable y para perfusi\xf3n EFG (Equivalente farmac\xe9utico gen\xe9rico).",null)
B.Fz=new A.af("V\xeda de administraci\xf3n","Se administra mediante inyecci\xf3n intravenosa lenta (durante al menos 3-5 minutos) o, preferiblemente, mediante perfusi\xf3n intravenosa lenta en 20-30 minutos.",null)
B.FB=new A.af("V\xeda de administraci\xf3n","La cefazolina generalmente se administra por v\xeda intravenosa (IV) o intramuscular (IM). La elecci\xf3n de la v\xeda depender\xe1 de la gravedad de la infecci\xf3n y de la condici\xf3n cl\xednica del paciente.",null)
B.FC=new A.af("Mecanismo de acci\xf3n","La cefazolina pertenece al grupo de antibi\xf3ticos conocidos como cefalosporinas. Su mecanismo de acci\xf3n radica en interferir con la s\xedntesis de la pared celular bacteriana, lo que lleva a la lisis y muerte de las bacterias.",null)
B.FK=new A.af("V\xeda Intravenosa","Tratamiento de n\xe1useas y v\xf3mitos retardados inducidos por quimioterapia como opci\xf3n de segunda l\xednea.",null)
B.FM=new A.af("Mecanismo de acci\xf3n","Es una combinaci\xf3n de dos componentes: la ampicilina, que es una penicilina con actividad antibacteriana, y el sulbactam, que act\xfaa como inhibidor de las enzimas que descomponen las penicilinas. Esta combinaci\xf3n ampl\xeda el espectro de acci\xf3n y ayuda a superar la resistencia bacteriana.",null)
B.FN=new A.af("Mecanismo de acci\xf3n","Ejerce su mecanismo de acci\xf3n a trav\xe9s de la inhibici\xf3n de la s\xedntesis de prostaglandinas y leucotrienos, sustancias que median en los procesos vasculares y celulares de la inflamaci\xf3n, as\xed como en la respuesta inmunol\xf3gica. Esto se traduce en que reducen la vasodilataci\xf3n, disminuyen el exudado de fluido, la actividad leucocitaria, la agregaci\xf3n y desgranulaci\xf3n de los neutr\xf3filos, la liberaci\xf3n de enzimas hidrol\xedticos por los lisosomas, la producci\xf3n de radicales libres de tipo super\xf3xido y el n\xfamero de vasos sangu\xedneos (con menor fibrosis) en los procesos cr\xf3nicos.",null)
B.FO=new A.af("Mecanismo de acci\xf3n","El minoxidil tiene un efecto vasodilatador directo sobre el m\xfasculo liso arterial, produciendo una reducci\xf3n de las resistencias perif\xe9ricas y un descenso de la presi\xf3n arterial. El minoxidil no tiene efectos bloqueantes adren\xe9rgicos ni depende del sistema nervioso central ya que retiene toda su actividad en presencia de la denervaci\xf3n adren\xe9rgica. Parece ser que el minoxidil retrasa la hidr\xf3lisis de AMP-c\xedclico al inhibir una de las fosfodiesterasas que intervienen en dicha hidr\xf3lisis. Como todos los vasodilatadores directos, el minoxidil produce una respuesta simp\xe1tica, con aumento de la frecuencia card\xedaca, volumen-latido y gasto card\xedaco, as\xed como un aumento marcado de la renina plasm\xe1tica.",null)
B.FS=new A.af("Mecanismo de acci\xf3n","La prazosina es un antagonista competitivo de los receptores adren\xe9rgicos a-1 postsin\xe1pticos de a diferencia de fenoxibenzamina y fentolamina, que son antagonistas inespec\xedficos de los receptores alfa. La prazosina no activa la liberaci\xf3n de norepinefrina y, por tanto, tiene una menor incidencia de taquicardia refleja. La prazosina causa vasodilataci\xf3n perif\xe9rica debido a la inhibici\xf3n selectiva y competitiva de los receptores adren\xe9rgicos alfa 1 postsin\xe1pticos vasculares, reduciendo as\xed la resistencia y la presi\xf3n arterial vascular perif\xe9rica.",null)
B.FT=new A.af("Mecanismo de acci\xf3n","Analg\xe9sico narc\xf3tico agonista de los receptores opi\xe1ceos \xb5, y en menor grado de los kappa, en el sistema nervioso central (SNC).",null)
B.FV=new A.af("Mecanismo de acci\xf3n","Analg\xe9sico y antipir\xe9tico, inhibidor de la s\xedntesis de prostaglandinas perif\xe9rica y central por acci\xf3n sobre la ciclooxigenasa. Bloquea la generaci\xf3n del impulso doloroso a nivel perif\xe9rico. Act\xfaa sobre el centro hipotal\xe1mico regulador de la temperatura.",null)
B.FZ=new A.af("Indicaciones","Utilizado para el tratamiento de diversas infecciones causadas por bacterias sensibles, como infecciones del tracto respiratorio, infecciones del tracto urinario, infecciones de la piel y tejidos blandos, infecciones \xf3seas, entre otras.",null)
B.G1=new A.af("Mecanismo de acci\xf3n","Inhibici\xf3n de la producci\xf3n y liberaci\xf3n de interleucina II e inhibe la activaci\xf3n de linfocitos T en reposo inducida por interleucina II.",null)
B.G2=new A.af("Presentaci\xf3n","Everolimus Accord 10 mg comprimidos EFG",null)
B.G3=new A.af("Mecanismo de acci\xf3n","Inhibe la activaci\xf3n de c\xe9lulas T inducida por la mayor\xeda de los est\xedmulos, mediante bloqueo de la transducci\xf3n de se\xf1ales intracelulares dependientes e independientes de Ca.",null)
B.G4=new A.af("V\xeda de administraci\xf3n","La vancomicina s\xf3lo se administra como infusi\xf3n intravenosa de forma lenta, de al menos una hora de duraci\xf3n o a una velocidad m\xe1xima de 10 mg/min. Debe estar suficientemente diluida.",null)
